import React, { useState, useEffect, useContext } from "react";
import { Typography, Button, FormGroup, FormControlLabel, Checkbox } from '@material-ui/core';
import Favorite from '@material-ui/icons/Favorite';
import FavoriteBorder from '@material-ui/icons/FavoriteBorder';

import { auditorAccountDatas, tenantAccountDatas, managerAccountDatas } from '../data';
import { Context } from '../Context';
import Navbar from "../Navbar";
import useStyles from '../styles';

function Account() {
  const {
    accountState,
    setAccountState,
    getAccountInfo
  } = useContext(Context);

  const {
    acc_id,
    branch_id,
    employee_id,
    email,
    username,
    first_name,
    last_name,
    hp,
    mgr_id,
    role_id,
    store_id,
    type_id,
  } = accountState;

  useEffect(() => {
    getAccountInfo();
  }, []);

  const styles = useStyles();

  return (
    <main className={styles.main}>
      <Navbar />
      <br />
      <Typography variant="h3" align='center'>Account</Typography>
      <br />
      <Typography>{acc_id}</Typography>
      <Typography>{branch_id}</Typography>
      <Typography>{employee_id}</Typography>
      <Typography>{email}</Typography>
      <Typography>{username}</Typography>
      <Typography>{first_name}</Typography>
      <Typography>{last_name}</Typography>
      <Typography>{hp}</Typography>
      <Typography>{role_id}</Typography>
      <Typography>{mgr_id}</Typography>
      <Typography>{store_id}</Typography>
      <Typography>{type_id}</Typography>
    </main>
  );
}

export default Account;
